Mobiliário: Bancada com tábua de corte com arrumação; duas bancadas com tábua de corte; armário;

Equipamento informático: Painel elétrico "sua vez"; sistema de som marca Panasonic;

Equipamento geral: Vitrina expositora refrigerada marca Framec; balcão expositor refrigerado marca Tasselli modelo Ambra matrícula 11110; balcão expositor refrigerado marca Tasselli,modelo Ambra, matrícula 1089LL; balcão expositor refrigerado em L marca Tasselli, modelo Ambra, matrícula 11841; duas armadilhas elétrica para insetos marca Fiamma; dispensador de senhas; dois expositores em gancho em inox; armário com lavatório; máquina de selar a vácuo marca Kleiner; câmara refrigerada com aproximadamente 2m x 2m marca Tasseli; bancada em inox com dois lavatórios; linha aérea de transporte de carne em inox; esterilizador de facas em inox com nove facas; termoacumulador marca Teka; lava mãos em inox marca Mecanipol; balança marca Medines;

